import axios from "./axios";

import urlConfig from "@/utils/urlConfig";

export const getHomeData = (param) =>{
    return axios.request({
        url:urlConfig.home.getHomeData,
    })
}
export const editUser = (param) =>{
    return axios.request({
        url:urlConfig.user.editUser,
        method:'post',
        data:param
    })
}
export const addUser = (param) =>{
    return axios.request({
        url:urlConfig.user.addUser,
        method:'post',
        data:param
    })
}
export const getUserList = (param) => {
    return axios.request({
        url:urlConfig.user.getUserList,
        method:'get',
        data:param
    })
}
export const delUser = (param) => {
    return axios.request({
        url:urlConfig.user.delUser,
        method:'post',
        data:param
    })
}
export const getMenu = (param) => {
    return axios.request({
        url:urlConfig.login.getMenu,
        method:'post',
        data:param
    })
}
